    state = {
        data: [],
        pagination: {
            page: 1,
            total: 0,
        },
        selectedTags: ['All'],
    };
    componentDidMount() {
        this.getData();
    }

    getData() {
        this.getMyLearningPagination(this.state.pagination).then((res: AxiosResponse<any>) => {
            this.setState({
                data: res.data.data,
                pagination: {
                    page: res.data.page,
                    total: res.data.total,
                },
            });
        });
    }

    getMyLearningPagination = (params: any) => {
        return axios.get("localhost:12006/practice/get", {
            params: params,
        });
    }

